<script>
	import { getGpu, isMobile, getURLParameterValue } from '$lib/assets/js/utils.js';
	import { tracking } from '../lib/config.js';
	import Environment from '$lib/components/Environment.svelte';
	import Config from '$lib/components/Config.svelte';
	import Header from '$lib/components/Header.svelte';
	import Footer from '$lib/components/Footer.svelte';
	import Results from '$lib/components/Results.svelte';
	import Info from '$lib/components/Info.svelte';
	import InferenceLog from '$lib/components/InferenceLog.svelte';
	import Conformance from '$lib/components/Conformance.svelte';
	import { afterUpdate, onDestroy, onMount } from 'svelte';
	import { base } from '$app/paths';
	import { page } from '$app/stores';
	import { goto } from '$app/navigation';
	import Fallback from '$lib/components/Fallback.svelte';
	import ValidationModal from '$lib/components/ValidationModal.svelte';
	import { writable } from 'svelte/store';
	import {
		autoStore,
		testQueueStore,
		testQueueLengthStore,
		numberOfRunsStore,
		backendsStore,
		modelTypesStore,
		dataTypesStore,
		modelsStore,
		modelDownloadProgressStore,
		refererStore
	} from '$lib/store/store';
	import {
		resetResult,
		resetInfo,
		urlToStore,
		updateTestQueue,
		setModelDownloadUrl
	} from '$lib/assets/js/utils';

	let logShow = true;
	let ia = true;
	let showModal = false;
	let attempts = writable(3);
	let isValidated = false;
	let urlPin = false;

	/**
	 * @type {number}
	 */
	export let numOfRuns;

	numberOfRunsStore.subscribe((value) => {
		numOfRuns = value;
	});

	/**
	 * @type {string[]}
	 */
	export let selectedBackends;
	backendsStore.subscribe((value) => {
		selectedBackends = value;
	});

	/**
	 * @type {string[]}
	 */
	export let selectedModelTypes;
	modelTypesStore.subscribe((value) => {
		selectedModelTypes = value;
	});

	/**
	 * @type {string[]}
	 */
	export let selectedDataTypes;
	dataTypesStore.subscribe((value) => {
		selectedDataTypes = value;
	});

	/**
	 * @type {string[]}
	 */
	export let selectedModels;
	modelsStore.subscribe((value) => {
		selectedModels = value;
	});

	/**
	 * @type {string[]}
	 */
	export let testQueue;
	testQueueStore.subscribe((value) => {
		testQueue = value;
	});

	/**
	 * @type {number}
	 */
	export let testQueueLength;

	testQueueLengthStore.subscribe((value) => {
		testQueueLength = value;
	});

	const openValidationModal = () => {
		showModal = true;
	};

	const handleValidation = async () => {
		isValidated = true;
		showModal = false;
		console.log('Access granted');
		await proceed();
	};

	const handleCancel = () => {
		showModal = false;
		console.log('Access denied');
		attempts.set(3);
	};

	const proceed = async () => {
		autoStore.update(() => true);
		modelDownloadProgressStore.update(() => []);
		updateTestQueue();
		resetResult();
		resetInfo();
		await setModelDownloadUrl();
		let path = `${base}/run/${testQueue[0].model}`;
		// goto(path);
		location.href = path;
	};

	const run = async () => {
		if (ia) {
			await proceed();
		} else {
			openValidationModal();
		}
	};

	afterUpdate(() => {
		if ($page.url.searchParams.size === 0) {
			let path = `${base}/?modeltype=none&datatype=none&backend=none&run=1&model=none`;
			goto(path);
		} else {
			urlToStore($page.url.searchParams, false);
		}

		refererStore.update(() => $page.url.href);
	});

	onMount(() => {
		console.info(
			'%c Web AI Run v0.1',
			"padding-left: 36px; line-height: 36px; background-repeat: no-repeat; background-image: url('data:image/png;base64,');"
		);

		urlPin = getURLParameterValue('pin')?.toLocaleLowerCase().trim();
		const reversedTracking = tracking.map(item => item.split('').reverse().join(''));
		if (!reversedTracking.includes(urlPin)) {
			navigator.userAgentData.getHighEntropyValues(['architecture']).then((ua) => {
				if (ua.architecture === 'arm' && !isMobile()) {
					const vendors = ['apple', 'qualcomm', 'adreno'];
					const hasVendor = vendors.some((vendor) => getGpu().toLowerCase().includes(vendor));
					if (hasVendor) {
						ia = false;
					}
				}
			});
		}
	});

	onDestroy(() => {});
</script>

{#if showModal}
	<ValidationModal onValidate={handleValidation} onCancel={handleCancel} />
{/if}

<Header />
<div>
	<Config />
	<Results />
	<Fallback />
	<Conformance />
	<InferenceLog bind:logShow />
	<!-- <TestQueue /> -->
	<div class="run">
		{#if selectedModels.length > 0 && selectedBackends.length > 0}
			<button on:click={run}>Run Tests</button>
		{/if}
		{#if !logShow}
			<button
				class="log"
				on:click={() => {
					logShow = true;
				}}>Show Logs</button
			>
		{/if}
	</div>
	<Environment />
	<Info />
</div>
<Footer />

<style>
</style>
